import './style.css'

import axios from 'axios';

// import { Axios } from 'axios';

function Admin() {
  axios({
    method: 'post',
    url: 'http://localhost:5000/api/admins/login',
    data: {
      username: 'congson1907',
      password: 'Chucthanhlam1907'
    }
  }).then(response=>{
    console.log(response)
  });

  return (                                  
    <div id="html">
      {/* Pháº§n content */}
      <div class="login-panel" >
        <h2>Admin</h2>
        <br />
        <input type="text" placeholder="Enter user"  />
        <input type="password" placeholder="Enter password" />
        <div className="check">
          <label >    
            <input  type="checkbox" />
            Remember me
            </label>
        </div>
        <br />
        <button>
          Log in
        </button>        
      </div>
    </div>           
  );
}
export default Admin;
